      <label for="regno">Reg No:</label>
      <br></br>
      <form>
        <input id="regno" value="" type="text" onChange={handleChangeReg} />
        <button onClick={handleSearchRegNo}>Add Comment</button>
      </form>
    </div>
  );
}

